import React from 'react'

function Graphics() {
  return (
    <div className="graphics">
      <img alt="graphic" src="https://images.unsplash.com/photo-1470229538611-16ba8c7ffbd7?crop=entropy&cs=tinysrgb&fit=crop&fm=jpg&h=600&ixid=eyJhcHBfaWQiOjF9&ixlib=rb-1.2.1&q=80&w=1000"></img>
    </div>
  )
}

export default Graphics
